import './IngredientsList.css';

function IngredientsList() {
    return (
    <div className="ingredients">
       <h1>Ingredients</h1>
       <ul></ul>
       Lillet Blanc (5 cl)
Schweppes Russian Wild Berry (10 cl)
Himbeere(n) (2 Stück)
Erdbeere(n) (1 Stück)
Eiswürfel
    </div>
    )
}

export default IngredientsList;
